var script_f38_55_39792=[" ",
"",
"var calctxt = '';",
"var xmltxt = '';",
"var htmtxt = '';",
"",
"",
"",
"function PolycythemiaVera_fx() {",
"",
"with(document.PolycythemiaVera_form){",
"",
"mcResult = \"Insufficient\";",
"",
"setScore0 = 0;",
"setScore1 = 0;",
"setScore2 = 0;",
"",
"if (cc1.checked){ setScore0 = setScore0 + 1;",
"}",
"if (cc2.checked){ setScore0 = setScore0 + 1;",
"}",
"if (cc3.checked){ setScore1 = setScore1 + 1;",
"}",
"if (cc4.checked){ setScore2 = setScore2 + 1;",
"}",
"if (cc5.checked){ setScore2 = setScore2 + 1;",
"}",
"if (cc6.checked){ setScore2 = setScore2 + 1;",
"}",
"if (cc7.checked){ setScore2 = setScore2 + 1;",
"}",
"if (setScore0 >= 2 && setScore1 >= 1 && setScore2 >= 0) mcResult = \"Diagnostic\";",
"if (setScore0 >= 2 && setScore1 >= 0 && setScore2 >= 2) mcResult = \"Diagnostic\";",
"mccriteria.value = mcResult + ' with:\r\\n' + setScore0 + \" Group A \r\\n\" + setScore1 + \" Group B \r\\n\" + setScore2 + \" Group C \r\\n\";",
"",
"",
"}",
"",
"}",
""].join("\n");
