var title_f38_55_39802="FL grade 2";
var content_f38_55_39802=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F85890%7EHEME%2F63064&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F85890%7EHEME%2F63064&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Follicular lymphoma, grade 2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Scattered throughout the centrocyte-like cells are five to 15 large, centroblast-like cells. Hematoxylin, phloxine, and saffron stain.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Ioachim HL, Medeiros LJ. Ioachim's Lymph Node Pathology, 4th ed, Lippincott Williams &amp; Wilkins, Philadelphia 2009. Copyright &copy; 2009 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Follicular lymphoma grade II (follicular mixed lymphoma)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 289px; height: 309px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There is an intimate admixture of small cleaved cells (centrocytes) and large non-cleaved cells (centroblasts).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Warnke, RA, Weiss, LM, Chan, JK, Cleary, ML, Dorfman, RF. Tumors of the lymph nodes and spleen. Atlas of tumor pathology (electronic fascicle), Third series, fascicle 14, 1995, Washington, DC. Armed Forces Institute of Pathology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
