var title_f38_55_39803="Differential diagnosis of memory loss";
var content_f38_55_39803=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F51421&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F51421&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of memory loss",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Symptom",
"      </td>",
"      <td class=\"subtitle1\">",
"       Usual cause",
"      </td>",
"      <td class=\"subtitle1\">",
"       Examples",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Gradual onset of short-term memory loss and functional impairment in more than one domain:",
"      </td>",
"      <td class=\"sublist_other_start\" colspan=\"1\" rowspan=\"3\">",
"       Dementia",
"      </td>",
"      <td class=\"sublist_other_start\" colspan=\"1\" rowspan=\"3\">",
"       Alzheimer disease, Parkinson dementia, Lewy body dementia, Pick's disease, alcohol-related dementia, Creutzfeld-Jacobs disease",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       I. Executive function (finances, shopping, cooking, laundry, transportation)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       II. Basic activities of daily living (feeding, dressing, bathing, toileting, transfers)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Stepwise, sudden deterioration in cognition; episodes of confusion, aphasia, slurred speech, focal weakness",
"      </td>",
"      <td>",
"       Cerebrovascular disease",
"      </td>",
"      <td>",
"       Vascular dementia, multi-infarct dementia, Binswanger's dementia (subcortical dementia)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Acute cognitive impairment with clouded sensorium; difficulty with attention; may have hypersomnolence",
"      </td>",
"      <td>",
"       Delirium",
"      </td>",
"      <td>",
"       Hypo- or hyperglycemia, hypo- or hypernatremia, hypoxemia, anemia, intermittent cerebral ischemia, thyrotoxicosis, myxedema, alcohol withdrawal, sepsis, drugs (especially cholinergics, benzodiazepines, etc)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Complains of memory loss, decreased concentration, impaired judgment, feels worse in morning and hopeless",
"      </td>",
"      <td>",
"       Depression",
"      </td>",
"      <td>",
"       Minor depression, dysthymic disorder, major depression, pathologic grief reaction",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
